import React from 'react'

class NavBar extends React.Component{
    render(){
        return(
            <nav className="navbar navbar-dark bg-dark text-white">
                <span>{this.props.inf}</span>
                <span>{this.props.n}</span>
            </nav>
        )
    }
}

export default NavBar;
